import React from 'react';
import Homepage from './components/Homepage';
import { BrowserRouter } from 'react-router-dom';
import { Route, Switch } from 'react-router-dom';
import NavBar from './components/NavBar';
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <NavBar />
        <main>
          <Switch>
            <Route exact path="/">
              <Homepage />
            </Route>
            <Route exact path="/">
              <SignupPage exact path="/signup" />
            </Route>
            <Route exact path="/">
              <LoginPage />
            </Route>
            <Route>
              <p>Hmmm.I can&apos; t seem to find what you want.</p>
            </Route>
          </Switch>
        </main>
      </BrowserRouter>
    </div>
  );
}

export default App;
